window.bookSummaryJSON = "<p><b>Lyam Gerard is my mortal enemy… and the father of my unborn baby.</b></p> <p>I should have known he was a monster when I betrayed him. I should have realized that in the ruthless world of the mafia, my actions would be met with punishment. But I fell for the wounded bad boy who knew just what I craved.</p> <p>Now, I am his possession, and he's determined to make me pay for my sins… On my knees. Bent over his desk. Tied to his bed.</p> <p>I shouldn't want this—shouldn't want him—yet part of me yearns to submit to his dark, depraved demands.</p> <p>In Lyam's world, loyalty is everything. And when he uncovers the truth I've been hiding all along, I know that will be the end of us…</p> <p>Because it will be the end of me...</p> <p>Possess Me<i> is a complete standalone in the Masters of Corsica series. This is a dark, anti-hero romance with elements of violence. For mature listeners.</i></p>"; 
